import React from 'react';

export default function NuestraHistoria() {
  return (
    <div className="bg-gray-50 py-12">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center">
          <h2 className="text-4xl font-bold tracking-tight text-gray-900">Nuestra Historia</h2>
          <p className="mx-auto mt-3 max-w-2xl text-xl text-gray-600 sm:mt-4">
            Herba nació de la pasión por la comida saludable y el deseo de crear un impacto positivo en el mundo. Desde nuestros humildes comienzos hasta nuestro crecimiento continuo, nos esforzamos por ofrecer lo mejor en cada platillo.
          </p>
        </div>
      </div>
    </div>
  );
}
